INSERT INTO `dp_emails` (`id`, `key`, `name`, `value`) VALUES
(1, 'CONFIRM-TO-MEMBER', 'Confirm E-Mail for new member', 'Hello,\n\nThis is not SPAM, this is an e-mail from [sitename] containing the information you need to continue the signup process...\n\nYou recently were at the [sitename] website and signed up, you must continue the signup process and enter your account information.  To do so, you can navigate to the below URL:\n\nClick to this link to confirm your registration: [confpage]?cid=[confhash]\n\nConfirmation Code: [confcode]\n\nThank you for your time,\n\n[sitename] Services Team\n[hostname]\n\\\\\\"ISLAMIC PAYMENT GATEWAY\\\\\\"'),
(2, 'SIGNUP-TO-MEMBER', 'DinarPal Notification - Successfully Registered', 'Peace Be Upon You !\r\n\r\nYou recently were registered the [sitename] network therefore we sent your account login information to you.\r\n\r\nYou can find such information below:\r\n---\r\nUsername: [username]\r\nPassword: [password]\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you\r\n\r\nSincerely\r\n\r\nThe Management\r\n[hostname]\r\n'),
(3, 'SIGNUP-TO-ADMINS', 'New Member Signed Up As You Shared In Social Media', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing the information about your groups...\r\n\r\nA new member has signed up under your dinarpal account! \r\n\r\n----------------------------------\r\nMember Username: [username]\r\nEmail Address: [newmail]\r\n---------------------------------- \r\n\r\nKeep up the good work! \r\nThank you for promoting [sitename]!\r\n\r\n[sitename] Service Team\r\n\\\\\\"Islamic Payment Gateway\\\\\\"'),
(4, 'UPDATE-MEMBER-PROFILE', 'DinarPal Notification - Your Profile Has Been Updated ', 'Peace Be Upon You !!\r\n\r\nYour info has been updated.\r\n\r\nThank You\r\n\r\nSincerely\r\nThe Management\r\n[hostname]\r\n'),
(5, 'UPDATE-BANK-INFORMATION', 'Your bank information was changed!', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing the information you need to continue the profile update process...\r\n\r\nYou recently were at the [sitename] website and updated your bank information. If it is not so please check of the your account.\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(6, 'UPDATE-CARD-INFORMATION', 'Your credit card information was changed!', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing the information you need to continue the profile update process...\r\n\r\nYou recently were at the [sitename] website and updated your credit card information. If it is not so please check of the your account.\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(7, 'SEND-MONEY', 'DinarPal Notification - Money Waiting !!!', 'Peace Be Upon You !!!\r\n\r\n[username] has just successfully sent you money.\r\nThe details transaction as follow:-\r\n\r\nFrom: [username]\r\nE-Mail: [email]\r\nAmount Received: [amount]\r\nComments: [comments]\r\n\r\nThank You\r\n\r\nSincerely\r\n\r\nThe Management\r\n[hostname]\r\n'),
(8, 'REQUEST-MONEY', 'DinarPal`s Members Request You To Send Payment', 'Hello [fullname],\r\n\r\nThis is not SPAM, this is an e-mail from [sitename].\r\n\r\nA member of [sitename] has requested money!\r\n\r\nFrom Email: [buyeradr]\r\nAmount: [amount]\r\n\r\nIn order for you to send this user money, you must create an account on [sitename].\r\n\r\nTo complete this transaction, you need to click the link below (or if there is no link, copy the address to your web browser) and sign up for an account. Instructions on approving or denying the transaction can be found on our website.\r\n[singpage]\r\n\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(9, 'SEND-ESCROW', 'Money Waiting', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification of money paid by Amanah Account to your account...\r\n\r\nA [sitename] user has just successfully sent you money! Please look at the below details for information on this transaction.\r\n\r\nSender: [username]\r\nSender\\\\\\''s E-Mail: [email]\r\nAmount Received: [amount]\r\nSender\\\\\\''s Comments: [comments]\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(10, 'CONFIRM-ESCROW', 'Payment by Amanah Account was confirmed!', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail containing a notification that escrow was confirmed...\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"Islamic Payment Gateway\\\\\\"'),
(11, 'CANCEL-ESCROW', 'Payment by Amanah Account was cancelled!', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification that escrow was cancelled...\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(12, 'REFUND-ESCROW', 'Payment by Amanah Account was refunded!', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification that escrow was confirmed...\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(13, 'DOWNLINE-CHANGE', 'You have a new member as you shared in social media', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing the information about your downline...\r\n\r\nA new member has signed up under your account! \r\n\r\n----------------------------------\r\nMember Username: [username]\r\nEmail Address: [emailadr]\r\n---------------------------------- \r\n\r\nKeep up the good work! \r\n\r\nRemember, you will get 2.5% of all the DinarPal fees this new member generates... \r\n\r\n\r\nThank you for promoting [sitename]!\r\n\r\n[sitename] Service Team\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(14, 'PAYMENT-MONEY', 'You have make a payment', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification of money paid from your account...\r\n\r\nYou have just successfully make payment! Please look at the below details for information on this transaction.\r\n\r\nSender: [username]\r\nSender\\\\\\''s E-Mail: [email]\r\nAmount Received: [amount]\r\nSender\\\\\\''s Comments: [comments]\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nIf you do not have a [sitename] account,  please create an account\r\nto get the money.  It only takes a few minutes and it is Free!!!\r\n\r\nIf this is the FIRST payment you received at this email address\r\nthrough [sitename], please log into your account, click the \\\\\\"VIEW ALL TRANSACTIONS\\\\\\" menu item, then check all your transactions.\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"Islamic Payment Gateway\\\\\\"'),
(15, 'SUBSCRIPTION-MONEY', 'Subscription Notification', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification of money paid from your account...\r\n\r\nYou have just successfully make subscription! Please look at the below details for information on this transaction.\r\n\r\nSender: [username]\r\nSender\\\\\\''s E-Mail: [MailAddr]\r\nAmount Received: [amount]\r\nSender\\\\\\''s Comments: [comments]\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nIf you do not have a [sitename] account,  please create an account\r\nto get the money.  It only takes a few minutes and it is Free!!!\r\n\r\nIf this is the FIRST payment you received at this email address\r\nthrough [sitename], please log into your account, click the \\\\\\"VIEW ALL TRANSACTIONS\\\\\\" menu item, then check all your transactions.\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(16, 'PAYMENT-MONEY-TO-OWNER', 'Payment from DinarPal', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification of money paid to your account...\r\n\r\nA [sitename] user has just successfully make payment! Please look at the below details for information on this transaction.\r\n\r\nSender: [username]\r\nSender\\\\\\''s E-Mail: [buyeradr]\r\nAmount Received: [amount]\r\nSender\\\\\\''s Comments: [comments]\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nIf you do not have a [sitename] account,  please create an account\r\nto get the money.  It only takes a few minutes and it is Free!!!\r\n\r\nIf this is the FIRST payment you received at this email address\r\nthrough [sitename], please log into your account, click the \\\\\\"VIEW ALL TRANSACTIONS\\\\\\" menu item, then check all your transactions.\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(17, 'SUBSCRIPTION-MONEY-TO-OWNER', 'A member has just successfully make subscription!', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification of money paid from your account...\r\n\r\nA [sitename] user has just successfully make subscription! Please look at the below details for information on this transaction.\r\n\r\nSender: [username]\r\nSender\\\\\\''s E-Mail: [buyeradr]\r\nAmount Received: [amount]\r\nSender\\\\\\''s Comments: [comments]\r\n\r\nYou can access your account anytime at:\r\n[lognpage]\r\n\r\nIf you do not have a [sitename] account,  please create an account\r\nto get the money.  It only takes a few minutes and it is Free!!!\r\n\r\nIf this is the FIRST payment you received at this email address\r\nthrough [sitename], please log into your account, click the \\\\\\"VIEW ALL TRANSACTIONS\\\\\\" menu item, then check all your transactions.\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"ISLAMIC E-WALLET\\\\\\"'),
(18, 'RESTORE-PASSWORD', 'Lost Password', 'Assalamualaikum & Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing the information you need to continue the signup process...\r\n\r\nDont worry you are not the one who forgot the password. \r\n\r\nSo Your password for [sitename] account is: [password]\r\n\r\nPlease log in to [sitename] by following this link: \r\n[lognpage]\r\n\r\nThank you for your time,\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n\\\\\\"Islamic Financial System\\\\\\"'),
(19, 'CONFIRM-NEW-EMAIL', 'New E-mail address added', 'Dear [fullname],\r\nYou have sucessfully added a new email address but you have to confirm it first.\r\n[emailpage]?c=[confcode]&u=[uid]'),
(20, 'NEW-EMAIL-ACTIVATED', 'New E-mail address successfully added', 'Dear [fullname],\r\nYour email address has been successfully verified.'),
(21, 'PAYMENT-TO-UNREGMEMBER', 'Money Waiting', 'Hello,\r\n\r\nThis is not SPAM, this is an e-mail from [sitename] containing a notification of money paid to you.\r\n\r\nA [sitename] user has just successfully sent you money! Please look at the below details for information on this transaction.\r\n\r\nSender: [username]\r\nSender''s E-Mail: [emailadr]\r\nAmount Received: [amount]\r\nSender''s Comments: [comments]\r\n\r\n\r\nTo get the money you have first to register to [sitename] using the same email address this email is sent to.\r\nUse that link to coninue registration process: [usersite]\r\nThis email is valid during 10 days. If you don''t signup within this period, money invoice will be cancelled.\r\n\r\nThank you!\r\n\r\n[sitename] Services Team\r\n[hostname]\r\n"THE NEW ONLINE UNIVERSAL PAYMENT SYSTEM"');
